import React from "react";
import villableue from "../assets/images/villa_bleue.jpg";

export default function Villableue() {
    return (
      <main style={{ padding: "1rem 0" }}>
        <h2>Page de la Villa Bleue</h2>
        <img src={villableue} alt="villa_rouge" />
      </main>
    );
  }
